import React from 'react';
import './App.css';
import UpdateSample from './Pages/UpdateSample';
import Signup from './Pages/Signup';
import PanelSelection from './Components/PanelSelection';
import AddSample from './Pages/AddSample';
import AddSampleDetails from './Components/AddSampleDetails';
import AddKnittingDetailsForm from './Components/AddKnittingDetails'; // Import your form component

import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'; // Update for React Router v6

function App() {
  return (
    <Router>
      <Routes>
        {/* Define routes with the new syntax */}
        <Route path="/" element={<AddSampleDetails />} />
        <Route path="/knitting-details" element={<AddKnittingDetailsForm />} />
        <Route path="/update-sample" element={<UpdateSample />} />
        <Route path="/signup" element={<Signup />} />
        {/* Add more routes as needed */}
      </Routes>
    </Router>
  );
}

export default App;
